var i = 0;
var speed = 5;
function typeWriter(txt) {
    if (i < txt.length) {
    
    i++;
    setTimeout(typeWriter(txt), speed);
    }
}

function typeWriter(text, delay = 5) {
    for (let i = 0; i < text.length; i++) {
    if (text.charAt(i) === "\n") {
        setTimeout(() => {
        document.getElementById("idea").innerHTML += "<br>"; }, delay * i);;
    } else {
        setTimeout(() => {
        document.getElementById("idea").innerHTML += text[i]; }, delay * i);;
    }
    
    }
}

function clearScreen() {
    document.getElementById("idea").innerHTML = "";
}